// src/router/index.js
import Vue from "vue";
import Router from "vue-router";
import DashboardLayout from "@/layout/dashboard/DashboardLayout.vue";
import Dashboard from "@/views/Dashboard.vue";
import Yard from "@/views/Dashboard/Yard.vue";

Vue.use(Router);

const routes = [
  {
    path: "/",
    component: DashboardLayout,
    redirect: "/dashboard",
    children: [
      {
        path: "dashboard",
        name: "dashboard",
        component: Dashboard,
        children: [
          {
            path: "yard",
            name: "yard",
            component: Yard,
          },
        ],
      },
      // 다른 라우트 설정
    ],
  },
  { path: "*", component: NotFound },
];

export default new Router({
  routes,
});
